import React, { useState, useEffect } from "react";
import "./styles/plan.css";
import settingIcon from "./assets/setting.png";

const Plan = () => {
  const [strategies, setStrategies] = useState([]);
  const [showModal, setShowModal] = useState(false);
  const [showEditModal, setShowEditModal] = useState(false);
  const [editedPlan, setEditedPlan] = useState(null);

  useEffect(() => {
    fetchStrategies();
  }, []);

  const fetchStrategies = async () => {
    try {
      const response = await fetch("http://localhost:8000/strategies/");
      if (!response.ok) {
        throw new Error("Failed to fetch strategies");
      }
      const data = await response.json();
      setStrategies(data);
    } catch (error) {
      console.error("Error fetching strategies:", error.message);
    }
  };

  const handleSubmit = async (formData) => {
    try {
      const response = await fetch("http://localhost:8000/strategies/", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(formData),
      });
      if (!response.ok) {
        throw new Error("Failed to add strategy");
      }
      setShowModal(false);
      fetchStrategies();
    } catch (error) {
      console.error("Error adding strategy:", error);
    }
  };
  const handlePlansSettingsClick = (item, e) => {
    console.log("Clicked settings icon with item:", item);
    setEditedPlan(item);
    setShowEditModal(true);
  };

  const handleCloseModal = () => {
    setShowEditModal(false);
  };
  const handlePlanEditFormSubmit = async (e) => {
    console.log(e);
    e.preventDefault(); // Ensure that preventDefault is called on the event
    try {
      const response = await fetch(
        `http://localhost:8000/strategies/${editedPlan.strategy_id}`,
        {
          method: "PUT",
          headers: {
            "Content-Type": "application/json",
          },
          body: JSON.stringify(editedPlan),
        }
      );
      if (!response.ok) {
        throw new Error("Failed to update plan");
      }
      handleCloseModal();
      fetch("http://localhost:8000/strategies")
        .then((response) => response.json())
        .then((data) => setStrategies(data))
        .catch((error) => console.error("Error fetching strategies:", error));
    } catch (error) {
      console.error("Error updating plan:", error);
      handleCloseModal();
    }
  };

  return (
    <div className="plan">
      <div className="header-card">
        <p>Plan</p>
        <i
          className="fa-solid fa-plus"
          id="new-btn"
          onClick={() => setShowModal(true)}
        ></i>
      </div>
      <div className="plan-list-container">
        <ul className="cards">
          {strategies.map((strategy) => (
            <li key={strategy.strategy_id} className="list-item">
              <div className="card-summary">
                <div className="category">
                  <h3>Plan:</h3>
                  <p>{strategy.plan}</p>
                </div>
                <div className="category">
                  <h3>Position:</h3>
                  <p>{strategy.position_sizing_rules}</p>
                </div>
                <div className="category">
                  <h3>Outcome:</h3>
                  <p>{strategy.outcome}</p>
                </div>
                <img
                  src={settingIcon}
                  alt="Setting"
                  className="setting-icon"
                  onClick={(e) => handlePlansSettingsClick(strategy, e)}
                />
              </div>
            </li>
          ))}
        </ul>
      </div>
      {showModal && (
        <Modal onClose={() => setShowModal(false)} onSubmit={handleSubmit} />
      )}
      {showEditModal && (
        <EditModal
          onClose={() => setShowEditModal(false)}
          onSubmit={handlePlanEditFormSubmit}
          initialFormData={editedPlan} // Pass the editedPlan as initialFormData
        />
      )}
    </div>
  );
};

const Modal = ({ onClose, onSubmit }) => {
  const [formData, setFormData] = useState({
    plan: "",
    outcome: "",
    author: "",
    max_loss_tolerance: 0,
    position_sizing_rules: "",
    tags: "",
    status: "Active",
    version: 0,
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    onSubmit(formData);
  };

  return (
    <div className="modal">
      <div className="modal-content">
        <span className="close" onClick={onClose}>
          &times;
        </span>
        <div className="card">
          <h1>New Plan</h1>
        </div>
        <form className="plan-form" onSubmit={handleSubmit}>
