            onChange={handleChange}
            className="modern-select"
          >
            <option value="Active">Active</option>
            <option value="Inactive">Inactive</option>
            <option value="Under Review">Under Review</option>
          </select>
          <input type="submit" value="Submit" />
        </form>
      </div>
    </div>
  );
};

